import NavIcon from "./NavIcon";
const NavBar = (props) => {
  window.addEventListener("scroll", function () {
    if (window.scrollY > 40) {
      console.log("123");
    } else {
      console.log("456");
    }
  });
  return (
    <>
      <div class="d-flex justify-content-between p-3 navbar fixed-top">
        <div>
          <p className="text-danger fw-bold h4">Movie App</p>
        </div>
        <div>
          <NavIcon></NavIcon>
        </div>
      </div>
    </>
  );
};
export default NavBar;
